import React, { useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import UserRegisterContex from "../Store/UserRegisterContex";
export const Header = () => {
  const navigate = useNavigate();
  const [state, dispatch] = useContext(UserRegisterContex);
  const userLogout = () => {
    let userdata = {
      isLogin: false,
    };
    dispatch({
      type: "logoutUser",
      payload: userdata,
    });
    navigate("/");
  };
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <ul className="navbar-nav mr-auto mb-0 h3">
      <li >
         <Link to="/Homepage">Home</Link>
        </li>
        <li >
          <a className="nav-link " ><Link to="/Features">Features</Link></a>
        </li>
        <li >
          <a className="nav-link " ><Link to="/Aboutus">About-Us</Link></a>
        </li>
        <li>
          <a className="nav-link" onClick={userLogout}>
            Logout
          </a>
        </li>
      </ul>
    </nav>
  );
};
